import cryptoJS from 'crypto-js'

const generateChecksum = (obj) => {
    const keys = Object.keys(obj)
    let str = ""
    keys.forEach(key => {
        str+=obj[key]
        str+="|"
    })
    return cryptoJS.SHA256.createHash('sha256').update(str).digest('hex')
}

export default generateChecksum
